Jigging Reel Saltwater Trolling Reels Big Ocean Conventional Fishing Reels
PROBEROS Seawater Trolling Reels Max Drag 16-40kg Aluminum CNC Machined Hollow Fishing Reels Jigging Reels (Left/Right-Hand)
Model:JN12
Color:blue
Gear Ratio:5.7:1
Retrieve:Left/Right-Hand
Weight (oz.):636g/22.4oz
1.Thicker than the original model, the main body weight reduction thickening increases the overall strength;
2.The main seat plate is riveted with SUS304 stainless steel, it is much stronger and harder than the screw. (Original seat plate is easy to loosen);
3.The main body and cover are locked with SUS304 stainless steel thick screw and Teflon Paste, the thick screw is extra-stronger, and the Teflon Paste can prevent the looseness. (The original model is M2 screw with poor locking strength and easy to loose without Teflon Paste);
4.One-Piece cold forged and machined of main cover and one-way bearing seat increased the strength and precision;
5.The wrench design is hide the crisp and loud sound structure, and the brake is adjusted to three gear positions FREE/STRIKE/FULL;
6.Replace the NMB Japan imported bearings which have been enlarged. (the original bearing is small and poor strength);
7.Changed from two ordinary 6-pin one-way bearings to 11-pin metal shrapnel long one-way bearings (static tension can be 35~40kg), which increases the tensile force value and strength of one-way force;
8.Increased reactionary ratchet to prevent one-way bearing failure;
9.Stainless steel easy-to-cut helical gear with a high gear ratio of 5.7:1, helical tooth is high strength and small noise;
10.The handle is change from screw to stainless steel rivet, it is strength and not easy loose;
11.The brake adjustment button is changed to the sound structure, which improves the adjustment precision and the sense of passage;
12.The small-line capacity reel is changed to the large-line capacity, the bigger capacity can be deep-water fishing;
13.Double brakes in a good design and processing precision make it more smooth。
